procedure(echostr)
{
	SYSTEM = _world.core.system;

	_self.request = _parameters;

	if(SYSTEM.isNull(_parameters._postContent))
	{
		SYSTEM.console.println("wechat GET");
		_result=echostr;
	}
	else
	{
		SYSTEM.console.println("wechat POST");
		req = _parameters._postContent;

		type = req.MsgType;
		if(type.equals("text"))
		{
			resp = _self.responseTemplate.xml;
			resp.ToUserName = req.FromUserName;
			resp.FromUserName = _self.wechatId;
			resp.Content = "received:".concat(req.Content);

			content = req.Content;
			if(content.startWith("ssh "))
			{
				index = content.indexOf(" ");	
				cmd = content.substring(index.plus(1));
				resp.Content = _world.examples.remote.ssh.$cmd();
			}

			//xxsvc.process(req.Content);
			_result = resp;
		}
		if(type.equals("event"))
		{

			if(req.Event.equals("subscribe"))
			{
				resp = _self.responseTemplate.xml;
				resp.Content = "thanks for subscribing me";

			}
			else
			{
				resp = _self.responseTemplate.xml;
				resp.Content = "event: ".concat(req.Event);				
			}


		}
		if(type.equals("location"))
		{
			msg = "you are from ".concat(req.Location_X).concat(req.Location_Y);
			resp = _self.responseTemplate.xml;
			resp.Content = msg;
		}

		if(type.equals("voice"))
		{
			msg = "got it.";
			resp = _self.responseTemplate.xml;
			resp.Content = msg;
		}


		_result = resp;
	}


}

