procedure(target,config)
{
	SYSTEM = _world.core.system;
	CONSOLE = SYSTEM.console;

	title = target.title;

	objId = SYSTEM.object.getId(target.navigation);
	objPath = SYSTEM.object.getPath(target.navigation);
	CONSOLE.println("do objID:".concat(objId.toString()));
	CONSOLE.println("do objPath:".concat(objPath));

	headerHtml = _self.renderObject(target.header, null);
	navigationHtml = _self.renderObject(target.navigation, null);
	mainHtml = _self.renderObject(target.main, null);
	sidebarHtml = _self.renderObject(target.sidebar, null);
	footerHtml = _self.renderObject(target.footer, null);

	html = _self.template;
	html = html.replaceAll("#title#", title);
	html = html.replaceAll("#header#", headerHtml);
	html = html.replaceAll("#navigation#", navigationHtml);
	html = html.replaceAll("#main#", mainHtml);
	html = html.replaceAll("#sidebar#", sidebarHtml);
	html = html.replaceAll("#footer#", footerHtml);

	_result = html;
}

